import React, { useEffect, useState } from 'react';
import { useRouteMatch, Link } from 'react-router-dom'
import { FiChevronLeft, FiChevronRight } from 'react-icons/fi'

import logoImg from '../../assets/logo.svg';
import {Header, RepositoryInfo, Issues} from './styles'
import api from '../../services/api'


interface repositoryParams{
  repository: string,

}

interface Repository {
  full_name: string;
  description: string;
  stargazes_count: number;
  forks_count: number;
  open_issues_count: number;
  owner : {
    login:string;
    avatar_url:string;

  }
}

interface Issue{
  id: number;
  title: string;
  user: {
    login: string;
  }
}

const Repository: React.FC = () => {
  const [ repository, setRepository] = useState<Repository | null>(null);
  const [issues, setIssues] = useState<Issue[]>('');
  const { params } = useRouteMatch<repositoryParams>();

  useEffect(() => {
    api.get(`repos/${params.repository}`).then(response => {
      console.log(response.data);
    })
    api.get(`repos/${params.repository}/issues`).then(response => {
      console.log(response.data);
    })
  }, [params.repository])

return (
  <>
  <Header>
    <img src = {logoImg} alt = "Github Explorer" />
    <Link to = "/" >
      <FiChevronLeft size={16}/>
      Voltar
      </Link>
  </Header>

  <RepositoryInfo>
    <header>
      <img src = "https://avatars3.githubusercontent.com/u/41807432?s=460&u=297837663d284b371e92198744169fe9819f6510&v=4" alt = "Felipe"/>
      <div>
        <strong>Felipe/Oi</strong>
        <p>Descrição</p>
      </div>
    </header>
    <ul>
    <li>
        <strong>1808</strong>
        <span>Stars</span>
      </li>
      <li>
        <strong>48</strong>
        <span>Fork</span>
      </li>
      <li>
        <strong>67</strong>
        <span>Issues abertas</span>
      </li>
    </ul>

  </RepositoryInfo>

  <Issues>
      <Link  to ="oidasodiasdo">
        <div>
          <strong>dasdasdasd</strong>
          <p>adasdasd</p>
        </div>
        <FiChevronRight size = {20}/>
      </Link>
  </Issues>
  </>
  );
};

export default Repository;
